So proud to be a part of this beautiful quilted display, celebration and spotlight on Black Womanhood and an honoring of our mothers. Thank you @apshantology for your vision and direction. Thank you @ava for being the midwife that is ushering this work into the world. 

I am the daughter of Terry, daughter of Barbara, daughter of Ozia... and I am mama of Fulano. 

